Muzikfilmo kun scenoj el baletoj Cigna lago de Chajkovskij, La fontano de Bahhchisaraj kaj Flamo de Parizo de Boris Asafjev. La filmon partoprenas du plej grandaj rusaj baletistinoj - Galina Ulanova kaj Maja Pliseckaja. Vd. pli detale che http://kinejo.blogsome.com/2008/07/18/majstroj-de-la-rusa-baleto-1953/

A musical film with scenes from Tchaikovsky^s Swan Lake and Boris Asafiev^s The Fountain of Bakhchisarai and The Flames of Paris. Starring roles belong to the greatest Russian ballerinas - Galina Ulanova and Maya Plisetskaya. Internal subtitles in Esperanto.

